визначає умови купівлі-продажу природного газу російського, казахстанського, узбецького та туркменського походження;
• ВАТ “Газпром”  приймає на себе зобов’язання поставляти, а НАК “Нафтогаз України” приймати та оплачувати в період з 1 січня 2009р. по 31 грудня 2019р. природний газ обсягом 40 млрд. м3 у 2009р., а починаючи з 2010р. – 52 млрд. м3/рік ;
• протягом кожного року Нафтогаз зобов’язаний прийняти та оплатити не менше 80% річної контрактної кількості (РКК);
• Покупцю забороняється реалізовувати поставлений Продавцем газ за межі України;
• контрактна ціна газу встановлюється за формулою, яка визначається залежно від цін на газойль і мазут, що
склалися в попередній 9-місячний період на ринку Південної Європи (базис поставки – Середземне море, Італія);
базова ціна встановлена в розмірі $450/1 000 м3 (фактична ціна, згідно з Доповненням від 21 квітня 2010р.,
знижується на суму зменшення митних платежів, якщо це передбачено Постановою Уряду РФ; фактична ціна газу,
що поставляється обсягом понад 30 млрд. м3 у 2010р. та понад 40 млрд. м3 з 2011р., не підлягає зниженню);
визначає, що:
• у разі відбору Нафтогаз понад 6% місячних обсягів поставки з квітня по вересень включно, він повинен сплатити
штраф у 150% поточної ціни газу, а в разі відбору з жовтня по березень включно – 300%;
• врегулювання спорів між сторонами в Арбітражному інституті Торговельної палати м.Стокгольм (Швеція).

Замовник і Виконавець щорічно підписують Технічну угоду, якою узгоджуються напрямки і протяжність транзиту
газу, однак відсутність підписаної угоди не є перешкодою для виконання сторонами їх контрактних зобов’язань;
 2010р. ставка плати за послуги з транзиту 1 000 м3 газу територією України встановлюється за формулою, що
містить базову складову в розмірі $2,04 за 1 000 м3 на 100 км із врахуванням рівня інфляції в ЄС та паливну скла-
дову, яка залежить від чинної ціни за газ, відстані транспортування (1 240 км) та коефіцієнта (0,03), що враховує
частку загального обсягу транспортування, яка йде на технологічні витрати;
Замовник щорічно здійснює оплату наданих Виконавцем послуг з транзиту газу територією України шляхом пере-
рахування грошових коштів на рахунок Виконавця до 20 числа місяця, наступного за місяцем надання послуг;
врегулювання спорів сторонами відбувається в Арбітражному інституті Торговельної палати м.Стокгольм (Швеція).

